public class Solution {
    public IList<int> LastVisitedIntegers(IList<string> words) {
        List<int> lastVisited = new List<int>();
        List<int> nums = new List<int>();
        int prevCount = 0;

        foreach (string word in words) {
            if (word == "prev") {
                prevCount++;
                int index = nums.Count - prevCount;
                if (index >= 0) {
                    lastVisited.Add(nums[index]);
                } else {
                    lastVisited.Add(-1);
                }
            } else {
                nums.Add(int.Parse(word));
                prevCount = 0; // reset prevCount as we encounter an integer
            }
        }

        return lastVisited;
    }
}
